create table alumni(
	roll_number int unsigned not null,
    first_name varchar(20) not null,
    middle_name varchar(20), 
    last_name varchar(20),
	guardian_name varchar(40),	
    entrance_through varchar(10),
    degree varchar(30) not null, 
    branch varchar(30) not null, 
	CPI numeric(4,2) not null, 
    ABC_ID char(12),
    year_of_graduation int not null, 
    placed_via varchar(30) not null,
	current_profession varchar(30) not null, 
    alumni_email varchar(60), 
    personal_email varchar(60),
    professional_email varchar(60),
	date_of_birth date,
    home_town varchar(30), 
    picture BLOB,
    marital_status varchar(15),
    house_no varchar(10),
    street_name varchar(20),
	city varchar(30),
    state varchar(30),
    pincode int, primary key (roll_number)
 );
 
create table mobile_number(
	roll_number int unsigned,
    mobile_number varchar(15),
    primary key (mobile_number),
    foreign key (roll_number) references alumni(roll_number)
    on delete cascade
    on update cascade
);
create table education(
	institute varchar(40),
    degree varchar(40),
    descipline varchar(40),
    city varchar(30), 
    primary key (institute, degree, descipline)
);
create table courses(
	course_ID char(5),
    course_name varchar(40) not null,
    number_of_credits char(1) not null,
    primary key (course_ID)
);

create table instructors( 
	instructor_id char(8), 
    name varchar(40) not null,
    work_email varchar(60), 
    office varchar(20), 
    primary key (instructor_ID)
);

create table department(
	department_name varchar(30),
	faculty_building varchar(30),
	number_of_faculty int not null, 
    primary key (department_name)
);

create table projects(
	title varchar(30),
    project_statement varchar(200),
    duration varchar(10),
    budget numeric(10,2),
    primary key(title,project_statement),check(budget>=0)
);

create table achivements(
	achivement_title varchar(40),
    description varchar(200),
    primary key(achivement_title)
);
create table donation(
	transaction_ID varchar(20),
    amount numeric(10,2),
    date_of_transaction date not null,
    primary key(transaction_ID),
    check (amount>0)
);
create table other_donations(
	transaction_ID varchar(20),
    purpose varchar(30),
    foreign key(transaction_ID) references donation(transaction_ID)
    on delete cascade
    on update cascade,
    primary key(transaction_ID)
);

create table financial_aid(
	transaction_ID varchar(20),
    scholarship_name varchar(30),
    eligibility_criterian varchar(30),
    foreign key(transaction_ID) references donation(transaction_ID)
    on delete cascade
    on update cascade,
    primary key(transaction_ID)
);
create table hostel (
	hostel_name varchar(15),
    room_no varchar(10) ,
    academic_year int ,
    primary key(academic_year,hostel_name,room_no)
);

create table jobs(
	work_ID varchar(20),
    designation varchar(20), 
    salary int unsigned not null,
    location varchar(30),
    tenure varchar(10),
    primary key (work_ID)
);

create table organization( 
	organization_name varchar(30),
    field_of_work varchar(20), 
    primary key (organization_name)
);

create table public_platform (
	roll_number int unsigned,
	linkedin varchar(150),
	github varchar(150),
	instagram varchar(150), foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade, primary key(roll_number)
);

create table extra_curriculars(
	activity_name varchar(30),
    domain varchar(30),
    primary key (activity_name,domain)
);
create table internships(
	organization_name varchar(30),
    year_offered year,
    stipend int unsigned,
    domain varchar(20),
    location varchar(30),
    foreign key(organization_name)
	references organization(organization_name) on delete cascade
    on update cascade,
    primary key(organization_name,domain, year_offered)
);
create table achieved(
	roll_number int unsigned,
    achivement_title varchar(30),
    date_of_achivement date, 
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
    foreign key(achivement_title) references achivements (achivement_title) on delete cascade
    on update cascade,
    primary key(roll_number,achivement_title)
);

create table other_studies(
	roll_number int unsigned,
    institute varchar(40), 
    degree varchar(40),
    descipline varchar(40),
    joining_year year not null,
    graduating_year year,
	foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
    foreign key(institute,degree,descipline) references education (institute,degree,descipline) on delete cascade
    on update cascade,
    primary key(roll_number,institute,degree,descipline)
);

create table course_taken(
	roll_number int unsigned,
    course_ID char(5),
    grade numeric(4,2) not null,
	foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
	foreign key(course_ID) references courses(course_ID) on delete cascade
    on update cascade,
    primary key(roll_number,course_ID)
);

create table minors_in(
	roll_number int unsigned, 
    department_name varchar(30),
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
	foreign key(department_name) references department(department_name) on delete cascade
    on update cascade,
    primary key(roll_number , department_name)
);

create table dual_majors(
	roll_number int unsigned, 
    department_name varchar(30),
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
	foreign key(department_name) references department(department_name) on delete cascade
    on update cascade,
    primary key(roll_number , department_name)
);

create table honors_in(
	roll_number int unsigned, 
    department_name varchar(30), 
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
	foreign key(department_name) references department(department_name) on delete cascade
    on update cascade,primary key(roll_number , department_name)
);

create table faculty_advisor(
	roll_number int unsigned,
    instructor_id char(8),
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
	foreign key(instructor_id) references instructors(instructor_id) on delete cascade
    on update cascade,primary key(roll_number)
);

create table supervisor(
	roll_number int unsigned,
    project_title varchar(30),
    project_statement varchar(200),
    instructor_id char(8), 
    foreign key(roll_number) references alumni(roll_number)on delete cascade
    on update cascade, 
    foreign key(project_title,project_statement) references projects(title,project_statement) on delete cascade
    on update cascade,
	foreign key(instructor_id) references instructors(instructor_id) on delete cascade
    on update cascade,
    primary key(roll_number,project_title,project_statement,instructor_id)
);

create table belongs_to(
	instructor_id char(8),
    department_name varchar(30),
    foreign key (instructor_id) references instructors(instructor_id) on delete cascade
    on update cascade,
	foreign key (department_name) references department(department_name) on delete cascade
    on update cascade,
    primary key (instructor_id,department_name)
);

create table participates_in(roll_number int unsigned, activity_name varchar(30),
	responsibility varchar(100),
    awards varchar(50), 
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
    foreign key(activity_name) references extra_curriculars(activity_name) on delete cascade
    on update cascade,
    primary key(roll_number,activity_name)
);

create table post(
	roll_number int unsigned,
    work_id varchar(20),
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
    foreign key(work_id) references jobs(work_ID) on delete cascade
    on update cascade,
    primary key(roll_number,work_id)
);

create table at(
	work_id varchar(20),
    organization_name varchar(30), 
    foreign key (work_id) references jobs(work_ID)on delete cascade
    on update cascade,
    foreign key (organization_name) references organization(organization_name) on delete cascade
    on update cascade,
    primary key(work_id)
);

create table offered_by(
	instructor_id char(8),
    course_id char(5),
    foreign key(instructor_id) references instructors(instructor_id) on delete cascade
    on update cascade,
	foreign key(course_id) references courses(course_ID) on delete cascade
    on update cascade,primary key(instructor_id,course_id)
);
create table donated(
	roll_number int unsigned,
    transaction_id varchar(20),
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
    foreign key(transaction_id) references donation(transaction_ID) on delete cascade
    on update cascade,
    primary key(transaction_id)
);

create table start_up(
	roll_number int unsigned,
    organization_name varchar(30),
    founding_year year not null,
    closing_year year,
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
	foreign key(organization_name)references organization(organization_name) on delete cascade
    on update cascade,
    primary key(roll_number,organization_name)
);
CREATE INDEX hostel_index ON hostel(hostel_name, room_no, academic_year);
create table allocated(
	roll_number int unsigned,
	hostel_name varchar(15),
    room_no varchar(10),
    academic_year int,
	foreign key(roll_number)references alumni(roll_number)on delete cascade
    on update cascade,
	foreign key(hostel_name, room_no, academic_year)references hostel(hostel_name, room_no, academic_year) on delete cascade
    on update cascade,
    primary key(roll_number,academic_year,hostel_name,room_no)
);
CREATE INDEX internships_index ON internships(year_offered,domain);
create table intern(
	roll_number int unsigned,
	organization_name varchar(30),
    year_offered year,
    domain varchar(20),
	foreign key(roll_number)references alumni(roll_number)on delete cascade
    on update cascade,
	foreign key(organization_name)references organization(organization_name)on delete cascade
    on update cascade,
	foreign key(year_offered, domain)references internships(year_offered, domain)on delete cascade
    on update cascade,
	primary key(roll_number, organization_name, year_offered, domain)
);

create table obtained(
	roll_number int unsigned,
    transaction_id varchar(20),
    obtained_date date,
    foreign key(roll_number) references alumni(roll_number) on delete cascade
    on update cascade,
    foreign key(transaction_id) references donation(transaction_ID) on delete cascade
    on update cascade,
    primary key(transaction_id, roll_number)
);


